import React from 'react'
import Link from 'next/link'
import { navbarLinks as link } from '../../NavigationMenu'


function Minnav() {
    return (
        <div className="bg-[#1d2128]">
            {link.map((nav) => {
                const { id, text, path } = nav;
                return (

                    <Link as={`/${nav.path}`} href='/[pages]'>

                        <a>{text}</a>
                    </Link>

                )
            })}
        </div>
    )
}

export default Minnav
